import { StyleSheet, Text, View } from 'react-native'
import React from 'react'

const  Card = () => {
  return (
    <View style={styles.mainContainer}
      >
        
   <View style={styles.Container} >

   </View>
    </View>
  )
}

const styles = StyleSheet.create({
  mainContainer:{
    padding:'30',
    borderRadius:5,
    shadowColor:'grey',
    shadowOffset:{width:0 , height: 0},
    shadowOpacity:'0.5',
    shadowRadius:8,
    elevation:8,

  }
})
export default  Card
